import React, {useState} from "react";
import MessageFeed from "../messagefeed";
import TextBox from "../textbox";


function ChatModule(props) {
    const[name, setName] = useState("Gennaro Napolitano");

    return(
        <div className={'flex-column d-flex flex-grow-1 '}>
            <div className={'card m-5 d-block flex-grow-1'}>

                <TextBox name={name} setName={setName}/>
                <MessageFeed name={name}/>
            </div>
        </div>
    );
}

export default ChatModule;
